import React from "react";

const About = () => {
  return (
    <div className="container about center">
      <div className="section">
        <h4>About</h4>
        <p>
          Hey! Noice to see you venturing here to know more about this website. Hangry is a React app created as a part of Codemonk Assignment. This webapp lets
          users signup and search for some mouthwatering yet maybe simple recipes and try them out. Also the users have the ability to create their own cookbook
          (sort of!) and edit them as they like.
        </p>
      </div>
    </div>
  );
};

export default About;
